import './App.css';
import Home from './screens/Home';
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from "react-router-dom";
import Login from './screens/Login';
function App() {
  return (
    <Router>
      <Routes>
        <Route exact path='/'><Home/></Route>
        <Route exact path='/login'>{<Login/>}</Route>
    </Routes>
    </Router>
  );
}

export default App;
